import React from 'react';
import { Container, Text } from '../Education/education.styled';
import { Name, Divider } from '../About/about.styled';
import { SubTitle } from './experience.styled';

const Experience = () => {
    return (
        <>
        <Name>Experience</Name>
        <Container>
        <SubTitle>Research</SubTitle>
        <Text>Graduate Researcher</Text>
        <Text>Pittsburgh, PA</Text>
        <Text>MinibioLab, PI: SiyangZheng</Text>
        <SubTitle>Work</SubTitle>
        </Container>
        <Divider />
        </>
    )
}

export default Experience;
